    <h1> Tamales </h1>  
    <p>Los tamales son un platillo que se remonta a la época prehispánica de México,
se dice que eran un alimento para las grandes fiestas, también se preparaban para agradecer la fertilidad de la tierra, en cualquier evento social y como ofrenda a los muertos.</p>
